I've got a message that needs to be broken into chunks because it exceeds the MTU size.

To do this I'm looping over an array of values and calling a func that sends the message and awaits the response. It looks like this:
```swift 
func sendMessage<M: PeripheralDataConvertible, R: Decodable>(message: M) async throws -> R {
	try await withThrowingTaskGroup(
		of: R.self,
		body: { [weak self] group in
			guard let self else {
				throw BluetoothError.noConnectionToPeripheralExists
			}

			var output = ""
			group.addTask {
				do {
					let values = self.characteristicValueUpdatedPublisher
						.filter { $0.characteristic.uuid == SwidgetBLEService.commandCharacteristicId }
						.compactMap {
							$0.value
						}
						.compactMap { String(data: $0, encoding: .utf8) }
						.handleEvents(
							receiveSubscription: { _ in
								Logger.shared.verbose("üí™üí™üí™ Subscribed to publisher!")
							},
							receiveOutput: { value in
								Logger.shared.verbose("üì´üì´üì´ Publisher received value: \(value)")
								output.append(value)
							}
						)
						.buffer(size: 10, prefetch: .keepFull, whenFull: .dropOldest)
						.values
						.eraseToStream()

					async let asyncResponse: R = self.gatherMultipartResponse(fromStream: values)

					try await self.setNotifyValue(
						true,
						forCharacteristicWithCBUUID: SwidgetBLEService.commandCharacteristicId,
						ofServiceWithCBUUID: SwidgetBLEService.serviceId
					)

					Logger.shared.debug("‚úçÔ∏è‚úçÔ∏è‚úçÔ∏è Sending message")
					try await self.writeValue(
						message,
						forCharacteristicWithCBUUID: SwidgetBLEService.commandCharacteristicId,
						ofServiceWithCBUUID: SwidgetBLEService.serviceId
					)

					// MARK: Gather multipart response
					Logger.shared.debug("üåæüåæüåæ Gathering response from stream")
					let response = try await asyncResponse

					return response

				} catch {
					Logger.shared.debug("Send message error: \(error)", tags: [.ble])
					throw error
				}
			}

			group.addTask {
				try await Task.sleep(nanoseconds: 8 * NSEC_PER_SEC)
				Logger.shared.debug("‚ùå Send Message timed out!!")
				throw BLEMeshError.timeout
			}

			let result = try await group.next()

			Logger.shared.verbose("‚úÖ One of the tasks completed!", tags: [.ble])
			group.cancelAll()

			if let result {
				return result
			} else {
				throw BLEMeshError.timeout
			}
		}
	)
}
```

And the loop that calls it looks like this:
```swift
