This works fine for single messages but in the loop it will sometimes get stuck on the `writeValue` line after successfully sending several messages.

I have no idea why it's hanging there. Does it get stuck if it does not receive the response or are there messages just getting enqueued but not dequeued? It's very frustrating because sometimes it will make it all the way through but very often it just gets stuck there. I implemented a retry mechanism and it never was able to successfully send a message again once it got stuck

Any idea what might be causing this? Or is there a better way to send multiple messages?

